INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES ("初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 2, 1, 322, 1, 0, 40011, 24001, 126001, 2, "クリア");
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES ("んーと。\nこれ、あげる。\nはい", 2, 1, 323, 1, 0, 40011, 24001, 126101, 3, "プレシア");
