INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES ("こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 2, 2, 325, 1, 0, 40011, 24001, 126001, 5, "クリア");
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES ("お兄。\nきてくれて、うれしい", 2, 2, 326, 1, 0, 40011, 24001, 126101, 6, "プレシア");
